import React from 'react';
import './Ladder.css';
import ladderData from './2019_1_OMM2_ladder.json';
import LadderRung from './LadderRung.js';


const ladder = (props) => {

    const teams = ladderData.teams;

    // teams.map(team =>  {
    //     <LadderRung
    //     position= {team.position}
    //     teamName= {team.teamName}
    //     points= {team.points}
    //     />
    // });

    return (
        <div className="slide" id="ladderSlide">
            <h3>Ladder</h3>
            {this.teams.map((team, index) => (
                        <LadderRung 
                        position= {team.position}
                        teamName= {team.teamName}
                        points= {team.points}
                        key={index} //change to game.id when set
                        />
                    )
            )
            }
        </div>
    )
}

export default ladder;
